INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(1, 'Ara dalle ali verdi', 'Ara chloropterus', 'Psittaciformes', 'Psittacidae', 'L\'ara dalle ali verdi &egrave; un uccello della famiglia degli Psittacidi, diffuso nelle foreste del Sudamerica settentrionale. &Egrave; la pi&ugrave; comune delle grandi ara e la pi&ugrave; grande delle specie del genere.', 'L\'ara dalle ali verdi depone solitamente 2 uova e lâ€™incubazione dura 35 giorni.', 'Nel peso &egrave; seconda solamente all\'ara giacinto, il pi&ugrave; grande uccello della famiglia delle ara. L\'apertura alare dell\'ara dalle ali verdi pu&ograve; raggiungere i 124 cm e la lunghezza totale del corpo i 99. Un adulto in salute pesa tra i 1250 e i 1700 grammi.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(2, 'Gorilla', 'Gorilla Gorilla', ' Primates', 'Hominidae', 'I gorilla occidentali vivono in un areale che comprende parti di Nigeria, Camerun, Repubblica centrafricana, Guinea Equatoriale, Gabon, Repubblica del Congo, Angola e l\'estremit&agrave; occidentale della Repubblica Democratica del Congo.', 'I gorilla femmina danno alla luce in genere un solo piccolo, a intervalli di 3-6 anni. Il tasso di mortalit&agrave; dei cuccioli nei primi tre anni &egrave; elevato.', 'Il gorilla &egrave; dotato di una notevole intelligenza. Un gorilla diventato famoso per la sua intelligenza &egrave; Koko, che &egrave; in grado di esprimersi a gesti e di usare diversi oggetti umani. Nel loro habitat i gorilla non hanno molti predatori. Talvolta i leopardi possono cacciare i cuccioli di gorilla, o anche le femmine, ma &egrave; raro che attacchino un maschio adulto.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(3, 'Elefante', 'Elephantidae', 'Proboscidea', 'Elephantidae', 'Gli elefanti sono diffusi in gran parte dell\'Africa subsahariana. Il loro habitat tipico &egrave; la grande savana alberata, ma possono adattarsi anche ad altri ambienti (ad esempio foreste).', 'La gestazione dura circa 21 mesi e viene partorito un piccolo che alla nascita pesa circa 120 kg. I parti gemellari sono molto rari e interessano meno del 2% delle nascite.', 'A partire dalla maturit&agrave; superiore, gli elefanti rivelano un carattere irrequieto, che non raramente pu&ograve; portare a episodi di aggressivit&agrave;, anche nei confronti dell\'uomo. Essi non sono monogami: di solito, il maschio vive con la femmina per un periodo piuttosto lungo, anche anni, per poi cambiare compagna. Gli elefanti sono dotati di una proverbiale memoria. Individui addomesticati hanno mostrato di poter riconoscere una persona anche a distanza di anni.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(4, 'Farfalla', 'Lepidoptera', 'Lepidoptera', 'Rhopalocera', 'Le farfalle si trovano in qualunque ambiente favorevole alla vita, dalle valli di pianura fino alle alte montagne.', 'A seconda della specie, una singola femmina pu&ograve; deporre, dopo l\'accoppiamento , da 50 a 5000 uova. Le uova hanno un diametro che pu&ograve; variare tra 2/10 di mm e 3 mm. Dopo uno sviluppo embrionale che puÃ² durare da 5-6 giorni fino a 5 mesi, nasce dall\'uovo una piccola larva: il bruco.', 'La farfalla pi&ugrave; grande esistente &egrave; la farfalla della regina Alessandra, che pu&ograve; raggiungere un\'apertura alare di 31 cm, una lunghezza corporea di 8 cm e un peso fino a 12 grammi. Nell\'isola greca di Rodi si trova la \"valle delle farfalle\", dove d\'estate migliaia di farfalle si radunano e stazionano attratte dalla resina di un albero, il <span xml:lang=\"la\">Liquidambar orientalis.</span>', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(5, 'Tarantola', 'Theraphosidae', 'Araneae', 'Avicularia avicularia', 'Le tarantole vivono generalmente in solitudine e sono cannibali, alcune specie come l\'<span xml:lang=\"la\">Avicularia avicularia</span> sembrano per&ograve; pi&ugrave; tolleranti alla presenza di un altro esemplare nella loro zona.', 'Dopo l\'accoppiamento, in base alla specie, verranno depositate dalle 50 alle 2000 uova che saranno controllate dalla madre per 6-7 settimane. Una volta schiuse le uova i piccoli di ragno rimarranno nelle vicinanze per qualche tempo per poi disperdersi in tutte le direzioni.', 'In uno speciale del <span xml:lang=\"en\">National Geographic</span> &egrave; stato illustrato come alcune trib&ugrave; delle Amazzoni cacciano e cucinano le tarantole. I ragni vengono catturati con l\'ausilio di un bastone e le loro zampe legate assieme per poi essere arrostiti ancora vivi. La <span xml:lang=\"la\">Theraphosa blondi</span> &egrave; considerata una prelibatezza dagli indigeni del Venezuela. Altro luogo in cui la tarantola &egrave; diffusa come cibo &egrave; la Cambogia.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(6, 'Tigre', 'Panthera Tigris', 'Carnivora', 'Felidae', 'Un tempo i territori occupati dalla tigre ricoprivano l\'intera Asia, dalla Turchia fino alla costa orientale della Russia. Nel ventesimo secolo le tigri sono mano a mano scomparse dalle zone a sud-ovest e in tutta la zona centrale dell\'Asia, nonch&eacute; dalle due isole indonesiane di Giava e Bali (causando la relativa estinzione di due sottospecie) e da vaste aree del Sud-Est e Asia orientale.', 'Il periodo di gestazione &egrave; di circa 93-114 giorni (3-4 mesi) e nella cucciolata vengono normalmente alla luce circa 4 cuccioli (si &egrave; registrato un massimo di sette) con un intervallo delle nascite di circa 10-20 minuti, caratterizzato dal fatto che ad ogni parto la madre mangia il cordone ombelicale, l\'amnios e la placenta. Il peso di ogni cucciolo si aggira intorno ad 1 kg.', 'La tigre maltese, o tigre blu, &grave; una forma di colorazione non provata della tigre, segnalata in gran parte dalla provincia cinese di Fujian. Si dice che abbiano una pelliccia blu scuro a righe grigie.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(7, 'Leone', 'Panthera Leo', 'Carnivora', 'Felidae', 'In tempi relativamente recenti i leoni vivevano in tutta la zona meridionale del continente eurasiatico, dalla Grecia all\'India, e sulla maggior parte dell\'Africa, eccezion fatta per la zona della foresta pluviale centrale e per il deserto del Sahara. Sembra che abbiano attraversato inoltre la Beringia e colonizzato l\'America in tempi passati, dallo Yukon al Per&ugrave;. Molte delle sottospecie che occupavano questo immenso areale sono tuttavia estinte.', 'La gestazione dura in media 110 giorni e la femmina mette alla luce da 1 a 4 cuccioli per volta in un covile appartato, che puÃ² essere rappresentato da una macchia di boscaglia, un letto di canne, una grotta o un altro luogo protetto. Essa si allontana pertanto dal branco al momento del parto. Mentre la prole Ã¨ ancora indifesa, la madre caccia da sola rimanendo comunque a una distanza ridotta dal covile.', 'Questi grandi felini hanno un ruolo fondamentale in mitologia, religione, arte e cultura popolare in generale. La figura del re della foresta e anche re degli animali &egrave; stata utilizzata in araldica e architettura. I leoni hanno spesso rappresentato uno spettacolo in arene e circhi antichi e moderni.Il leone &egrave; stato menzionato nella mitologia greca nella leggenda di Eracle dove l\'eroe affronta il leone di Nemea e nella mitologia egizia dove Sekhmet era raffigurata sia con la testa di una leonessa, sia come una leonessa in s&eacute;. Merita anche di essere menzionato Il re leone, uno dei massimi successi della <span xml:lang=\"en\">Disney</span> nella seconda met&agrave; del ventesimo secolo.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(8, 'Giraffa', 'Giraffa camelopardalis', 'Artiodactyla', 'Giraffidae', 'L\'habitat frammentato della giraffa si estende dal Ciad al nord al Sudafrica a sud, e dal Niger a ovest alla Somalia a est. Le giraffe generalmente vivono in savane, distese erbose e aree boschive aperte.', 'La gestazione della giraffa dura 400-460 giorni, dopo i quali nasce normalmente un unico piccolo, anche se non sono del tutto sconosciuti i parti gemellari.', 'Per tutto l\'anno, i maschi si affrontano in combattimenti a volte violenti. Siccome utilizzano prevalentemente il collo, gli anglosassoni hanno chiamato questi scontri \"collaggio\". La lotta viene talvolta scatenata da un maschio provocatore che si avvicina a un altro maschio e gli si pone di fronte, spavaldamente eretto sulle zampe rigide. Se l\'altro adotta lo stesso atteggiamento, la lotta &egrave; ingaggiata.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(9, 'Scimmia', 'Simiiformes', 'Primates', 'Cercopithecidae', 'La scimmia comune &egrave; considerato un primate esclusivo dell\'Africa e la sua distribuzione si &egrave; notevolmente ridotta negli ultimi secoli. Questa specie &egrave; strettamente legata alla presenza di zone alberate, poich&egrave; normalmente vive nella foresta umida tropicale e nelle foreste della savana.', 'La gestazione delle scimmie dura approssimativamente quanto quella di un essere umano, circa 240 giorni. La riproduzione e gli accoppiamenti non obbediscono alla legge del maschio pi&ugrave; forte tra i maschi e nemmeno della predominanza del sesso maschile su femminile. Siamo in una societ&agrave; matriarcale e sono le femmine a dominare.', 'Le scimmie cominciarono a differenziarsi circa 40 milioni di anni fa nei parvordini delle catarrine (scimmie del Vecchio Mondo) e delle platirrine, che andarono a colonizzare le Americhe (scimmie del Nuovo Mondo). 25 milioni di anni fa avvenne la differenziazione delle scimmie antropomorfe in seno alle catarrine.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(10, 'Fenicottero', 'Phoenicopterus', 'Phoenicopteriformes', 'Phoenicopteridae', 'Il fenicottero rosso e il fenicottero rosa sono due sottospecie della stessa specie: il primo vive nelle paludi del Golfo del Messico, mentre il secondo si trova nei laghi salati del Mediterraneo, dell\'Asia occidentale e dell\'Africa. Il fenicottero minore Ã¨ una specie di taglia piÃ¹ piccola e vive insieme al fenicottero rosa negli stessi laghi africani.', 'La nidificazione dei fenicotteri avviene in colonie dove le femmine costruiscono il nido a brevissima distanza tra loro. Ciascuna depone un solo uovo all\'interno di un nido a tronco di cono, fatto di fango e di altri materiali.', 'I fenicotteri producono una sostanza simile al \"latte di piccione\", costituito da grassi, proteine e carboidrati, che viene prodotto in ghiandole allineate nel tratto digerente superiore. Entrambi i genitori nutrono i loro piccoli e i giovani fenicotteri si nutrono di questo \"latte\" per circa due mesi, finchÃ© il loro becco non Ã¨ abbastanza sviluppato da poter filtrare il cibo.\r\n', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(11, 'Alpaca', 'Vicugna pacos', 'Artiodactyla', 'Camelidae', 'Gli alpaca sono allevati in grandi greggi che pascolano ad un\'altitudine compresa fra i 3500 e i 5000 metri sulle Ande del Per&ugrave; meridionale, della Bolivia settentrionale e del nord del Cile.', 'Le femmine danno alla luce un solo piccolo all\'anno perch&eacute; il loro periodo di gestazione &egrave; di circa 11 mesi e mezzo.', 'Lâ€™Alpaca &egrave; un piccolo parente del lama. Non supera i 90 cm di altezza al garrese e i 75 kg di peso. L\'alpaca non &egrave; ruminante, come tutti i camelidi possiede tre stomaci per la digestione della fibra. In media ogni animale mangia circa un chilogrammo di vegetali al giorno e come tutti i camelidi non ha bisogno di grandi quantit&agrave; di acqua. Esistono due razze di alpaca: la razza Huacaya e la razza Suri, rappresentando quest\'ultima solo il 10% della popolazione degli alpaca nel mondo.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(12, 'Pecora', 'Ovis Aries', 'Artiodactyla', 'Bovidae', 'Oltre a diverse regioni d\'Italia, l\'allevamento delle pecore &egrave; molto diffuso in Australia, in Nuova Zelanda, in Argentina e in Sudafrica.', 'Il perido di gestazione di una pecora ha una lunghezza di circa 150 giorni. Circa un mese prima del parto, la pancia si gonfia molto e risulta cadente verso il terreno e le mammelle iniziano a gonfiarsi.', '&Egrave; di carattere timido, ma, al contrario di quanto si possa pensare, &egrave; molto intelligente, dotata di buona memoria e facilit&agrave; di apprendimento.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(13, 'Testuggine', 'Testudines', 'Testudines', 'Testudinidae', 'Le specie dell\'ordine <span xml:lang=\"la\">Testudines</span> sono presenti in tutti i continenti eccetto l\'Antartide; la maggiore biodiversit&agrave; si concentra nelle regioni tropicali e subtropicali, ma un discreto numero di specie &egrave; presente anche nelle zone temperate. Popolano une grande variet&agrave; di habitat differenti. 7 specie sono tartarughe marine, 241 specie sono tartarughe d\'acqua dolce e infine 45 specie sono testuggini terrestri.', 'La deposizione delle uova avviene, a seconda della temperatura, dopo circa 4-7 settimane dallâ€™accoppiamento. Una femmina pu&ograve; deporre da 1 a 5 uova, a seconda delle dimensioni e dellâ€™et&agrave; dellâ€™esemplare. Nel corso di una stagione lo stesso animale pu&ograve; avere 2 o 3 deposizioni.', 'Le specie acquatiche riescono a raggiungere gli 8 km/h di velocit&agrave;, mentre le terrestri riescono a raggiungere a malapena gli 0,1 km/h.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(14, 'Orso Polare', 'Ursus Maritimus', 'Carnivora', 'Ursidae', 'L\'orso polare vive nell\'Artide. Il suo habitat &egrave; compreso in 6 nazioni: Canada, Stati Uniti, Russia, Groenlandia, Norvegia e Islanda.', 'Dopo l\'accoppiamento, la femmina dell\'orso polare inizia il periodo di gestazione che varia da 195 a 265 giorni e costruisce una tana nella neve dove far crescere ed allevare i cuccioli.', 'Il metodo di caccia pi&ugrave; famoso degli orsi polari &egrave; quello usato per le foche: il plantigrado sente il rumore della preda sotto il ghiaccio, si apposta presso una spaccatura e, non appena la preda esce per respirare, la uccide con una violenta zampata.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(15, 'Pinguino', 'Spheniscidae', 'Sphenisciformes', 'Spheniscidae', 'Delle 18 specie esistenti di pinguino, ben 12 vivono esclusivamente in Antartide e nelle circostanti acque dell\'oceano Meridionale, spingendosi sino alle coste meridionali di tollo; le restanti specie sono distribuite in Africa australe, Sud America, Australia e Nuova Zelanda.', 'I pinguini nidificano in colonie, dove ritornano dopo una stagione passata esclusivamente in mare a pescare. La maggior parte dei pinguini inizia a nidificare a marzo-aprile, con l\'arrivo dell\'inverno polare. Alcune specie costruiscono dei nidi rudimentali, fatti con pietre e piume.', 'Il nome pinguino &egrave; di etimo incerto. L\'ipotesi pi&ugrave; realistica lo fa risalire, attraverso il francese <span xml:lang=\"fr\">pingouin</span> e l\'inglese <span xml:lang=\"en\">penguin</span>, al bretone <span xml:lang=\"en\">penngwen</span> (\"testa bianca\") che identificava l\'alca impenne, una specie di uccello che popolava l\'Oceano Atlantico settentrionale, estinta nel 1844 a causa di una caccia incontrollata per ottenerne il grasso.', );
INSERT INTO `animale` (`ID_An`, `Comune_An`, `Scientifico_An`, `Ordine_An`, `Famiglia_An`, `Habitat_An`, `Riproduzione_An`, `Curiosita_An`, `Immagine_An`) VALUES
(16, 'Delfino', 'Delphinus delphis', 'Cetacea', 'Delphinidae', 'Il delfino comune vive in pratica nelle acque di tutto il mondo, in tutti gli Oceani e nei principali mari europei e asiatici. Le uniche zone dove non &egrave; stato avvistato sono le acque artiche.', 'L\'attivit&agrave; sessuale che si protrae per tutto l\'anno, anche se solitamente i parti si accentrano nei mesi estivi, anche alle latitudini pi&ugrave; basse. L\'unico nato resta con la madre molti mesi e l\'allattamento continua sino a 1, 5-2 anni. La riproduzione nella generalit&agrave; delle specie avverrebbe perci&ograve; a intervalli minimi di 2-3 anni. L\'et&agrave; della maturit&agrave; sessuale probabilmente oscilla tra i 5 anni del delfino comune e i 16 dell\'orca maschio, e si colloca per gran parte delle specie attorno agli 8-10 anni.', 'I delfini sono in grado di assolvere compiti di notevole complessitÃ  e come mimi hanno pochi rivali, abili come sono a memorizzare lunghe sequenze, in particolare quando l\'apprendimento comporta l\'uso dell\'apparato acustico. In qualche test rivaleggiano con gli elefanti. Va loro riconosciuta, come del resto ad altri mammiferi, una certa tendenza all\'innovazione spontanea, ma nessuno ha dimostrato in modo conclusivo che sappiano valutare a priori le conseguenze di un\'azione.', );

