INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(1, 'IMMERSIONE CON I DELFINI', 'Nuotare con i delfini Ã¨ una delle esperienze piÃ¹ emozionanti e divertenti che una persona possa vivere. Immergiti e impara a conoscere uno degli animali piÃ¹ intelligenti e giocosi presenti in natura. Seguiti dai nostri collaboratori, i visitatori (a gruppi di dieci) entreranno innanzitutto in una piscina per iniziare a interagire con i nostri delfini, in modo da comprendere rapidamente il loro comportamento. Successivamente, verrÃ  consegnata una muta e un salvagente per iniziare questa indimenticabile immersione.<br/><br/>\r\nL\'attivitÃ  Ã¨ aperta a tutti gli adulti e ai bambini dagli 8 anni in su. E\' consigliato comunicare in anticipo la volontÃ  di effettuare l\'immersione il giorno della visita, in modo da poter garantire la disponibilitÃ . Durata dell\'attivitÃ : 45 minuti circa.', );
INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(2, 'PASSEGGIATA CON I PRIMATI', 'Nel nostro parco, assistiti dal nostro staff, Ã¨ possibile interagire con i nostri esemplari di scimpanzÃ© comune, tra le specie piÃ¹ tranquille, amichevoli e curiose di interagire con altri esseri viventi, in particolare per quanto riguarda i cuccioli, ai quali, in determinate fasce orarie, si potrÃ  anche dare da mangiare.<br/>L\'attivitÃ  Ã¨ aperta a tutti gli adulti e ai bambini dai 10 anni in su accompagnati da un adulto.', );
INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(3, 'INCONTRO RAVVICINATO CON I LEONI', 'Chi non ha mai sognato di accarezzare uno dei felini piÃ¹ grandi in natura? Allo Zoo Creola tutto ciÃ² sarÃ  possibile! Nel corso della visita allo zoo, in orari predefiniti (presenti nel volantino che verrÃ  consegnato all\'ingresso), i nostri visitatori piÃ¹ coraggiosi, insieme al nostro staff, potranno interagire e dare da mangiare ai nostri leoni! <br/><br/>L\'attivitÃ  Ã¨ aperta a tutti gli adulti e ai bambini dai 10 anni in su accompagnati da un adulto.', );
INSERT INTO `attivita` (`ID_Att`, `Nome_Att`, `Descrizione_Att`, `Immagine_Att`) VALUES
(4, 'ATTIVITA\' DIDATTICHE PER LE SCUOLE', 'Per tutte le scuole, saranno disponibili, alla fine della visita al parco, una serie di laboratori didattici e attivitÃ  per imparare tutte le curiositÃ  della natura e in particolare del mondo animale. I bambini potranno interagire con alcuni piccoli animali, toccare e studiare vari reperti tra cui fossili, ossa di animali e altri reperti per conoscere le degli animali dello zoo e di altri estinti da milioni di anni. <br/><br/>L\'attivitÃ  Ã¨ dedicata a tutte le scuole e con un numero massimo di 25 bambini per turno. La prenotazione delle attivitÃ  Ã¨ obbligatoria e va comunicata al momento della prenotazione della visita allo zoo. Per le prenotazioni online, invece, Ã¨ richiesta la compilazione di un form. Durata dell\'attivitÃ : 1 ora circa\r\n', );

